import { GET_DOGS } from "../actions/constants";

let initialState = {
    dogs : [],
};

const root = (state = initialState, action) => {
    switch (action.type) {
        case GET_DOGS : 
        return {
            ...state,
            dogs: action.payload
        }
        default : 
        return state;
    }
};

export default root;
